.btn--inline {
  font-size: 6em;
  border-radius: 50%;
  height: 1.5em;
  width: 1.5em;
  @include flexedCentered;
  position: sticky;
  z-index: 20;
  background-color: rgba(167, 163, 163, 0.1);
  &:hover {
    background-color: rgba(201, 201, 201, 0.7);
  }

  i {
    padding: 0.2em;
    border-radius: 40%;
  }
}

#next {
  position: absolute;
  right: 0;
  // top: calc(100vh / 2);
  bottom: 10%;
  margin-right: 0.2em;
}

#prev {
  position: absolute;
  left: 0;
  bottom: 10%;
  margin-left: 0.2em;
}

.pagination-guard {
  height: 14em;
  width: 14em;
  background-color: rgba(250, 235, 215, 0.075);
  @include flexedCentered;
  position: relative;
  z-index: 10;
}

